import React, { useState } from "react";
import styles from "./Settings.module.css";

const Settings = () => {
  const [profileImage, setProfileImage] = useState<File | null>(null);
  const [name, setName] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [email, setEmail] = useState("");
  const [preferredSubject, setPreferredSubject] = useState("");
  const [organization, setOrganization] = useState("");
  const [language, setLanguage] = useState("en");

  const handleProfileImageChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    if (e.target.files && e.target.files[0]) {
      setProfileImage(e.target.files[0]);
    }
  };

  const handleDeleteAccount = () => {
    if (window.confirm("Are you sure you want to delete your account? This action cannot be undone.")) {
      // Add delete account logic here
      console.log("Account deleted");
    }
  };

  return (
    <div className={styles.settingsPage}>
      <div className={styles.header}>
        <h1>Settings</h1>
      </div>

      {/* General Settings Section */}
      <div className={styles.section}>
        <h2>General Settings</h2>
        <div className={styles.formGroup}>
          <label>Profile Image</label>
          <input type="file" onChange={handleProfileImageChange} />
          {profileImage && <p className={styles.fileInfo}>Selected: {profileImage.name}</p>}
        </div>
        <div className={styles.formGroup}>
          <label>Name</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter your name"
          />
        </div>
        <div className={styles.formGroup}>
          <label>Username</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            placeholder="Enter your username"
          />
        </div>
        <div className={styles.formGroup}>
          <label>Password</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="Enter your password"
          />
        </div>
        <div className={styles.formGroup}>
          <label>Email Address</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter your email address"
          />
        </div>
      </div>

      {/* Account Settings Section */}
      <div className={styles.section}>
        <h2>Account Settings</h2>
        <div className={styles.formGroup}>
          <label>Preferred Subject</label>
          <input
            type="text"
            value={preferredSubject}
            onChange={(e) => setPreferredSubject(e.target.value)}
            placeholder="Enter your preferred subject"
          />
        </div>
        <div className={styles.formGroup}>
          <label>Organization</label>
          <input
            type="text"
            value={organization}
            onChange={(e) => setOrganization(e.target.value)}
            placeholder="Enter your organization"
          />
        </div>
        <div className={styles.formGroup}>
          <label>Account Type</label>
          <select onChange={(e) => console.log(e.target.value)}>
            <option value="teacher">Teacher</option>
            <option value="student">Student</option>
          </select>
        </div>
        <div className={styles.formGroup}>
          <label>Language</label>
          <select
            value={language}
            onChange={(e) => setLanguage(e.target.value)}
          >
            <option value="en">English</option>
            <option value="sv">Swedish</option>
          </select>
        </div>
        <div className={styles.formGroup}>
          <button
            onClick={handleDeleteAccount}
            className={`${styles.button} ${styles.danger}`}
          >
            Delete Account
          </button>
        </div>
      </div>
    </div>
  );
};

export default Settings;
